clydjcr2d02aph8l5q9lws2jb	clydjbvi7003hh8l5vbxgs9fa	Nutty Chicken Curry	2024-07-08 22:10:13.381	• Red Chilli 1 large\n• Ginger 0.5\n• Garlic 1 large\n• Coriander Bunch\n• Sunflower Oil 1 tbsp\n• Chicken Breasts 4\n• Peanut Butter 5 tblsp\n• Chicken Stock 150ml\n• Greek Yogurt 200g	Finely slice a quarter of the chilli, then put the rest in a food processor with the ginger, garlic, coriander stalks and one-third of the leaves. Whizz to a rough paste with a splash of water if needed.\r\nHeat the oil in a frying pan, then quickly brown the chicken chunks for 1 min. Stir in the paste for another min, then add the peanut butter, stock and yogurt. When the sauce is gently bubbling, cook for 10 mins until the chicken is just cooked through and sauce thickened. Stir in most of the remaining coriander, then scatter the rest on top with the chilli, if using. Eat with rice or mashed sweet potato.	0
clydjco4l0277h8l5fd5ehjjv	clydjbvbq002sh8l5fb62g2tf	New York cheesecake	2024-07-08 22:10:09.574	• Butter 85g\n• Sour Cream 140g\n• Sugar 1tbsp\n• Cream Cheese 900g\n• Caster Sugar 250g\n• Plain Flour 3 tbs\n• Lemon Juice 1 ½ teaspoons\n• Eggs 3 Large\n• Sour Cream 250ml\n• Sour Cream 150ml\n• Caster Sugar 1 tbsp\n• Lemon Juice 2 tsp	Position an oven shelf in the middle of the oven. Preheat the oven to fan 160C/conventional 180C/gas 4. Line the base of a 23cm springform cake tin with parchment paper. For the crust, melt the butter in a medium pan. Stir in the biscuit crumbs and sugar so the mixture is evenly moistened. Press the mixture into the bottom of the pan and bake for 10 minutes. Cool on a wire rack while preparing the filling.\r\nFor the filling, increase the oven temperature to fan 200C/conventional 240C/gas 9. In a table top mixer fitted with the paddle attachment, beat the soft cheese at medium-low speed until creamy, about 2 minutes. With the mixer on low, gradually add the sugar, then the flour and a pinch of salt, scraping down the sides of the bowl and the paddle twice.\r\nSwap the paddle attachment for the whisk. Continue by adding the vanilla, lemon zest and juice. Whisk in the eggs and yolk, one at a time, scraping the bowl and whisk at least twice. Stir the 284ml carton of soured cream until smooth, then measure 200ml/7fl oz (just over 3⁄4 of the carton). Continue on low speed as you add the measured soured cream (reserve the rest). Whisk to blend, but don't over-beat. The batter should be smooth, light and somewhat airy.\r\nBrush the sides of the springform tin with melted butter and put on a baking sheet. Pour in the filling - if there are any lumps, sink them using a knife - the top should be as smooth as possible. Bake for 10 minutes. Reduce oven temperature to fan 90C/conventional 110C/gas 1⁄4 and bake for 25 minutes more. If you gently shake the tin, the filling should have a slight wobble. Turn off the oven and open the oven door for a cheesecake that's creamy in the centre, or leave it closed if you prefer a drier texture. Let cool in the oven for 2 hours. The cheesecake may get a slight crack on top as it cools.\r\nCombine the reserved soured cream with the 142ml carton, the sugar and lemon juice for the topping. Spread over the cheesecake right to the edges. Cover loosely with foil and refrigerate for at least 8 hours or overnight.\r\nRun a round-bladed knife around the sides of the tin to loosen any stuck edges. Unlock the side, slide the cheesecake off the bottom of the tin onto a plate, then slide the parchment paper out from underneath.	0
clydjcp47028dh8l5z55jzn0b	clydjbvi7003hh8l5vbxgs9fa	Chick-Fil-A Sandwich	2024-07-08 22:10:10.855	• Chicken Breast 1\n• Pickle Juice 1/4 cup\n• Egg 1\n• Milk 1/4 cup\n• Flour 1/2 cup\n• Icing Sugar 1 tbs\n• Paprika 1/2 tsp\n• Salt 1/2 tsp\n• Black Pepper 1/4 tsp\n• Garlic Powder 1/4 tsp\n• Celery Salt 1/4 tsp\n• Cayenne Pepper 1/2 tsp\n• Olive Oil 1 cup\n• Sesame Seed Burger Buns 1	Wrap the chicken loosely between plastic wrap and pound gently with the flat side of a meat tenderizer until about 1/2 inch thick all around.\r\nCut into two pieces, as even as possible.\r\nMarinate in the pickle juice for 30 minutes to one hour (add a teaspoon of Tabasco sauce now for a spicy sandwich).\r\nBeat the egg with the milk in a bowl.\r\nCombine the flour, sugar, and spices in another bowl.\r\nDip the chicken pieces each into the egg on both sides, then coat in flour on both sides.\r\nHeat the oil in a skillet (1/2 inch deep) to about 345-350.\r\nFry each cutlet for 2 minutes on each side, or until golden and cooked through.\r\nBlot on paper and serve on toasted buns with pickle slices.	0
clydjcq2w029jh8l5hpey679v	clydjbvi7003hh8l5vbxgs9fa	Spanish Tortilla	2024-07-08 22:10:12.105	• Onion 1 sliced\n• Olive Oil 4 tbsp\n• Butter 25g\n• Potatoes 400g\n• Garlic 6 cloves\n• Eggs 8\n• Parsley Handful\n• Baguette 1\n• Vine Tomatoes 4\n• Olive Oil drizzle	Put a large non-stick frying pan on a low heat. Cook the onion slowly in the oil and butter until soft but not brown – this should take about 15 mins. Add the potatoes, cover the pan and cook for a further 15-20 mins, stirring occasionally to make sure they fry evenly.\r\nWhen the potatoes are soft and the onion is shiny, crush 2 garlic cloves and stir in, followed by the beaten eggs.\r\nPut the lid back on the pan and leave the tortilla to cook gently. After 20 mins, the edges and base should be golden, the top set but the middle still a little wobbly. To turn it over, slide it onto a plate and put another plate on top, turn the whole thing over and slide it back into the pan to finish cooking. Once cooked, transfer to a plate and serve the tortilla warm or cold, scattered with the chopped parsley.\r\nTo accompany, take slices of warmed baguette, stab all over with a fork and rub with the remaining garlic, pile on grated tomatoes and season with sea salt and a drizzle of olive oil.	0
