clydje63j0405h8l5zn33brp0	clydjc06900m8h8l55lea7osu	Battenberg Cake	2024-07-08 22:11:19.519	• Butter 175g\n• Caster Sugar 175g\n• Self-raising Flour 140g\n• Almonds 50g\n• Baking Powder ½ tsp\n• Eggs 3 Medium\n• Vanilla Extract ½ tsp\n• Almond Extract ¼ teaspoon\n• Butter 175g\n• Caster Sugar 175g\n• Self-raising Flour 140g\n• Almonds 50g\n• Baking Powder ½ tsp\n• Eggs 3 Medium\n• Vanilla Extract ½ tsp\n• Almond Extract ¼ teaspoon\n• Pink Food Colouring ½ tsp\n• Apricot 200g\n• Marzipan 1kg\n• Icing Sugar Dusting	Heat oven to 180C/160C fan/gas 4 and line the base and sides of a 20cm square tin with baking parchment (the easiest way is to cross 2 x 20cm-long strips over the base). To make the almond sponge, put the butter, sugar, flour, ground almonds, baking powder, eggs, vanilla and almond extract in a large bowl. Beat with an electric whisk until the mix comes together smoothly. Scrape into the tin, spreading to the corners, and bake for 25-30 mins – when you poke in a skewer, it should come out clean. Cool in the tin for 10 mins, then transfer to a wire rack to finish cooling while you make the second sponge.\r\nFor the pink sponge, line the tin as above. Mix all the ingredients together as above, but don’t add the almond extract. Fold in some pink food colouring. Then scrape it all into the tin and bake as before. Cool.\r\nTo assemble, heat the jam in a small pan until runny, then sieve. Barely trim two opposite edges from the almond sponge, then well trim a third edge. Roughly measure the height of the sponge, then cutting from the well-trimmed edge, use a ruler to help you cut 4 slices each the same width as the sponge height. Discard or nibble leftover sponge. Repeat with pink cake.\r\nTake 2 x almond slices and 2 x pink slices and trim so they are all the same length. Roll out one marzipan block on a surface lightly dusted with icing sugar to just over 20cm wide, then keep rolling lengthways until the marzipan is roughly 0.5cm thick. Brush with apricot jam, 