clydjf7zq057bh8l57hdgfn7k	clydjc3s2010th8l5xzf57ja7	Spinach & Ricotta Cannelloni	2024-07-08 22:12:08.63	• Olive Oil 3 tbsp\n• Garlic 8 cloves chopped\n• Caster Sugar 3 tbsp\n• Red Wine Vinegar 2 tblsp\n• Chopped Tomatoes 3 400g Cans\n• Basil Leaves Bunch\n• Mascarpone 2 tubs\n• Milk 3 tbsp\n• Parmesan 85g\n• Mozzarella 2 sliced\n• Spinach 1kg\n• Parmesan 100g\n• Ricotta 3 tubs\n• Nutmeg pinch\n• Cannellini Beans 400g	First make the tomato sauce. Heat the oil in a large pan and fry the garlic for 1 min. Add the sugar, vinegar, tomatoes and some seasoning and simmer for 20 mins, stirring occasionally, until thick. Add the basil and divide the sauce between 2 or more shallow ovenproof dishes (see Tips for freezing, below). Set aside. Make a sauce by beating the mascarpone with the milk until smooth, season, then set aside.\r\n\r\nPut the spinach in a large colander and pour over a kettle of boiling water to wilt it (you may need to do this in batches). When cool enough to handle squeeze out the excess water. Roughly chop the spinach and mix in a large bowl with 100g Parmesan and ricotta. Season well with salt, pepper and the nutmeg.\r\n\r\nHeat oven to 200C/180C fan/gas 6. Using a piping bag or plastic food bag with the corner snipped off, squeeze the filling into the cannelloni tubes. Lay the tubes, side by side, on top of the tomato sauce and spoon over the mascarpone sauce. Top with Parmesan and mozzarella. You can now freeze the cannelloni, uncooked, or you can cook it first and then freeze. Bake for 30-35 mins until golden and bubbling. Remove from oven and let stand for 5 mins before serving.	0
clydjf8ve058hh8l5rcipjqay	clydjc3s2010th8l5xzf57ja7	Matar Paneer	2024-07-08 22:12:09.77	• Sunflower Oil 1 tbls\n• Paneer 225g\n• Ginger 2\n• Cumin 1 tsp\n• Turmeric 1 tsp\n• Coriander 1 tsp\n• Green Chilli 1\n• Tomato 4 large\n• Peas 150g\n• Garam Masala 1 tsp\n• Coriander Small bunch\n• Naan Bread to serve	Heat the oil in a frying pan over high heat until it’s shimmering hot. Add the paneer, then turn the heat down a little. Fry until it starts to brown at the edges, then turn it over and brown on each side – the paneer will brown faster than you think, so don’t walk away. Remove the paneer from the pan and drain on kitchen paper.\r\nPut the ginger, cumin, turmeric, ground coriander and chilli in the pan, and fry everything for 1 min. Add the tomatoes, mashing them with the back of a spoon and simmer everything for 5 mins until the sauce smells fragrant. Add a splash of water if it’s too thick. Season well. Add the peas and simmer for a further 2 mins, then stir in the paneer and sprinkle over the garam masala. Divide between two bowls, top with coriander leaves and serve with naan bread, roti or rice.	0
