clydjf3tn052nh8l5pe714i7d	clydjc3gp00zfh8l5wa7jx87a	Fish Stew with Rouille	2024-07-08 22:12:03.226	• Prawns 6 large\n• Olive Oil 3 tbs\n• Dry White Wine 150ml\n• Fish Stock 200ml\n• Fennel 1 small finely diced\n• Onion 1 small finely diced\n• Garlic 3 cloves Chopped\n• Potatoes 1 large\n• Orange 1\n• Star Anise 1\n• Bay Leaf 1\n• Harissa Spice 1 1/2 tsp\n• Tomato Puree 2 tbs\n• Chopped Tomatoes 400g\n• Mussels Handful\n• White Fish 200g\n• Thyme 2\n• Bread to serve	Twist the heads from the prawns, then peel away the legs and shells, but leave the tails intact. Devein each prawn. Fry the shells in 1 tbsp oil for 5 mins, until dark pink and golden in patches. Add the wine, boil down by two thirds, then pour in the stock. Strain into a jug, discarding the shells.\r\nHeat the rest of the oil in a deep frying pan or casserole. Add the fennel, onion and garlic, season, then cover and gently cook for 10 mins until softened. Meanwhile, peel the potato and cut into 2cm-ish chunks. Put into a pan of cold water, bring to the boil and cook for 5 mins until almost tender. Drain in a colander.\r\nPeel a strip of zest from the orange. Put the zest, star anise, bay and ½ tsp harissa into the pan. Fry gently, uncovered, for 5-10 mins, until the vegetables are soft, sweet and golden.\r\nStir in the tomato purée, cook for 2 mins, then add the tomatoes and stock. Simmer for 10 mins until the sauce thickens slightly. Season to taste. The sauce can be made ahead, then reheated later in the day. Meantime, scrub the mussels or clams and pull away any stringy beards. Any that are open should be tapped sharply on the worktop – if they don’t close after a few seconds, discard them.\r\nReheat the sauce if necessary, then stir the potato, chunks of fish and prawns very gently into the stew. Bring back to the boil, then cover and gently simmer for 3 mins. Scatter the mussels or clams over the stew, then cover and cook for 2 mins more or until the shells have opened wide. Discard any that remain closed. The chunks of fish should flake easily and the prawns should be pink through. Scatter with the thyme leaves.\r\nTo make the quick rouille, stir the rest of the harissa through the mayonnaise. Serve the stew in bowls, topped with spoonfuls of rouille, which will melt into the sauce and enrich it. Have some good bread ready, as you’ll definitely want to mop up the juices.	0
clydjf6a0055dh8l5971xcagt	clydjc3m30104h8l5utijdcjk	Tuna Nicoise	2024-07-08 22:12:06.408	• Potatoes 450g\n• Olive Oil 2 tblsp\n• Eggs 4\n• Red Wine Vinegar 1 tbls\n• Capers 2 tblsp\n• Sunflower Oil 50g\n• Red Onions ½\n• Spinach 100g\n• Tuna 400g	Heat oven to 200C/fan 180C/gas 6. Toss the potatoes with 2 tsp oil and some seasoning. Tip onto a large baking tray, then roast for 20 mins, stirring halfway, until crisp, golden and cooked through.\r\nMeanwhile, put eggs in a small pan of water, bring to the boil, then simmer for 8-10 mins, depending on how you like them cooked. Plunge into a bowl of cold water to cool for a few mins. Peel away the shells, then cut into halves.\r\nIn a large salad bowl, whisk together the remaining oil, red wine vinegar, capers and chopped tomatoes. Season, tip in the onion, spinach, tuna and potatoes, then gently toss together. Top with the eggs, then serve straight away.	0
clydjfb9s05b7h8l5xj25qtid	clydjc4jk011ih8l58zphplhy	Jerk chicken with rice & peas	2024-07-08 22:12:12.88	• Chicken Thighs 12\n• Lime 1/2\n• Spring Onions 1  bunch\n• Ginger 1 tbs chopped\n• Garlic 3 cloves\n• Onion 1/2\n• Red Chilli 3 chopped\n• Thyme 1/2 teaspoon\n• Lime Juice of 1\n• Soy Sauce 2 tbs\n• Vegetable Oil 2 tbs\n• Brown Sugar 3 tbs\n• Allspice 1 tbs\n• Basmati Rice 200g\n• Coconut Milk 400g\n• Spring Onions 1  bunch\n• Thyme 2 sprigs\n• Garlic 2 cloves chopped\n• Allspice 1 tbs\n• Kidney Beans 800g	To make the jerk marinade, combine all the ingredients in a food processor along with 1 tsp salt, and blend to a purée. If you’re having trouble getting it to blend, just keep turning off the blender, stirring the mixture, and trying again. Eventually it will start to blend up – don’t be tempted to add water, as you want a thick paste.\r\n\r\nTaste the jerk mixture for seasoning – it should taste pretty salty, but not unpleasantly, puckering salty. You can now throw in more chillies if it’s not spicy enough for you. If it tastes too salty and sour, try adding in a bit more brown sugar until the mixture tastes well balanced.\r\n\r\nMake a few slashes in the chicken thighs and pour the marinade over the meat, rubbing it into all the crevices. Cover and leave to marinate overnight in the fridge.\r\n\r\nIf you want to barbecue your chicken, get the coals burning 1 hr or so before you’re ready to cook. Authentic jerked meats are not exactly grilled as we think of grilling, but sort of smoke-grilled. To get a more authentic jerk experience, add some wood chips to your barbecue, and cook your chicken over slow, indirect heat for 30 mins. To cook in the oven, heat to 180C/160C fan/gas 4. Put the chicken pieces in a roasting tin with the lime halves and cook for 45 mins until tender and cooked through.\r\n\r\nWhile the chicken is cooking, prepare the rice & peas. Rinse the rice in plenty of cold water, then tip it into a large saucepan with all the remaining ingredients except the kidney beans. Season with salt, add 300ml cold water and set over a high heat. Once the rice begins to boil, turn it down to a medium heat, cover and cook for 10 mins.\r\n\r\nAdd the beans to the rice, then cover with a lid. Leave off the heat for 5 mins until all the liquid is absorbed. Squeeze the roasted lime over the chicken and serve with the rice & peas, and some hot sauce if you like it really spicy.	0
clydjfc6005cdh8l52796vg8q	clydjc4s50127h8l5deg6tjdf	Smoky Lentil Chili with Squash	2024-07-08 22:12:14.04	• Olive Oil 1 tbls\n• Onion 1\n• Leek 1 chopped\n• Garlic 3 cloves\n• Cumin 4 tsp ground\n• Coriander 2 tsp ground\n• Smoked Paprika 1 tsp\n• Cinnamon 1/2 tsp\n• Chili Powder 1 tsp\n• Cocoa 1 tsp\n• Dried Oregano 1/2 tsp\n• Diced Tomatoes 1 can\n• Water 3 cups\n• Carrots 3 chopped\n• Brown Lentils 1 1/2 cups\n• Sea Salt 1 tsp\n• Squash 1 Small\n• Cashews 1 Cup\n• Apple Cider Vinegar 1 tsp	Begin by roasting the squash. Slice it into thin crescents and drizzle with a little oil and sprinkle with sea salt. I added a fresh little sage I had in the fridge, but it’s unnecessary. Roast the squash a 205 C (400 F) for 20-30 minutes, flipping halfway through, until soft and golden. Let cool and chop into cubes.\r\nMeanwhile, rinse the lentils and cover them with water. Bring them to the boil then turn down to a simmer and let cook (uncovered) for 20-30 minutes, or until tender. Drain and set aside.\r\nWhile the lentils are cooking heat the 1 Tbsp. of oil on low in a medium pot. Add the onions and leeks and sauté for 5 or so minutes, or until they begin to soften. Add the garlic next along with the cumin and coriander, cooking for a few more minutes. Add the remaining spices – paprika, cinnamon, chilli, cocoa, Worcestershire sauce, salt, and oregano. Next add the can of tomatoes, the water or stock, and carrots. Let simmer, covered, for 20 minutes or until the veg is tender and the mixture has thickened up. You’ll need to check on the pot periodically for a stir and a top of of liquid if needed.\r\nAdd the lentils and chopped roasted squash. Let cook for 10 more minutes to heat through.\r\nServe with sliced jalapeno, lime wedges, cilantro, green onions, and cashew sour cream.\r\n\r\nSIMPLE CASHEW SOUR CREAM\r\n\r\n1 Cup Raw Unsalted Cashews\r\nPinch Sea Salt\r\n1 tsp. Apple Cider Vinegar\r\nWater\r\n\r\nBring some water to the boil, and use it to soak the cashews for at least four hours. Alternatively, you can use cold water and let the cashews soak overnight, but I’m forgetful/lazy, so often use the boil method which is much faster.\r\nAfter the cashews have soaked, drain them and add to a high speed blender. Begin to puree, slowly adding about 1/2 cup fresh water, until a creamy consistency is reached. You may need to add less or more water to reach the desired consistency.\r\nAdd a pinch of sea salt and vinegar (or lemon juice).	0
clydjf4is053fh8l5wvkrcmbl	clydjc3m30104h8l5utijdcjk	Parkin Cake	2024-07-08 22:12:04.132	• Butter 200g\n• Egg 1 large\n• Milk 4 tbs\n• Golden Syrup 200g\n• Black Treacle 85g\n• Brown Sugar 85g\n• Oatmeal 100g\n• Self-raising Flour 250g\n• Ground Ginger 1 tbs	Heat oven to 160C/140C fan/gas 3. Grease a deep 22cm/9in square cake tin and line with baking parchment. Beat the egg and milk together with a fork.\r\n\r\nGently melt the syrup, treacle, sugar and butter together in a large pan until the sugar has dissolved. Remove from the heat. Mix together the oatmeal, flour and ginger and stir into the syrup mixture, followed by the egg and milk.\r\n\r\nPour the mixture into the tin and bake for 50 mins - 1 hr until the cake feels firm and a little crusty on top. Cool in the tin then wrap in more parchment and foil and keep for 3-5 days before eating if you can – it’ll become softer and stickier the longer you leave it, up to 2 weeks.\r\n	0
clydjf7bo056jh8l53w3190qo	clydjc3s2010th8l5xzf57ja7	Bean & Sausage Hotpot	2024-07-08 22:12:07.765	• Sausages 8 large\n• Tomato Sauce 1 Jar\n• Butter Beans 1200g\n• Black Treacle 1 tbls\n• English Mustard 1 tsp	In a large casserole, fry the sausages until brown all over – about 10 mins.\r\n\r\nAdd the tomato sauce, stirring well, then stir in the beans, treacle or sugar and mustard. Bring to the simmer, cover and cook for 30 mins. Great served with crusty bread or rice.	0
clydjf8ae057ph8l5jrptm3tb	clydjc3s2010th8l5xzf57ja7	Cajun spiced fish tacos	2024-07-08 22:12:09.014	• cajun 2 tbsp\n• cayenne pepper 1 tsp\n• white fish 4 fillets\n• vegetable oil 1 tsp\n• flour tortilla 8\n• avocado 1 sliced\n• little gem lettuce 2 shredded\n• spring onion 4 shredded\n• salsa 1 x 300ml\n• sour cream 1 pot\n• lemon 1\n• garlic 1 clove finely chopped	Cooking in a cajun spice and cayenne pepper marinade makes this fish super succulent and flavoursome. Top with a zesty dressing and serve in a tortilla for a quick, fuss-free main that's delightfully summery.\r\n\r\nOn a large plate, mix the cajun spice and cayenne pepper with a little seasoning and use to coat the fish all over.\r\n\r\nHeat a little oil in a frying pan, add in the fish and cook over a medium heat until golden. Reduce the heat and continue frying until the fish is cooked through, about 10 minutes. Cook in batches if you don’t have enough room in the pan.\r\n\r\nMeanwhile, prepare the dressing by combining all the ingredients with a little seasoning.\r\nSoften the tortillas by heating in the microwave for 5-10 seconds. Pile high with the avocado, lettuce and spring onion, add a spoonful of salsa, top with large flakes of fish and drizzle over the dressing.	0
clydjfa2j059nh8l5nqaryvp3	clydjc4jk011ih8l58zphplhy	Three-cheese souffles	2024-07-08 22:12:11.324	• Butter 50g\n• Parmesan 25g\n• Milk 300ml\n• Bay Leaves 2\n• Plain Flour 5 tbs\n• English Mustard ½ tsp\n• Cayenne Pepper Pod of\n• Gruyère 140g\n• Eggs 3\n• Goats Cheese 8 slices\n• Double Cream 150ml\n• Spinach to serve	Heat oven to 200C/180C fan/ gas 6 and butter 4 small (about 200ml) ramekins. Sprinkle the Parmesan into the ramekins, turning until all sides are covered. Place the milk and bay leaves in a large saucepan over a gentle heat and bring to the boil. Turn off the heat and leave to infuse for 15 mins.\r\nDiscard the bay leaves, add the butter and flour, and return to a low heat. Very gently simmer, stirring continuously with a balloon whisk, for about 6 mins until you get a smooth, thick white sauce. Make sure that you get right into the corners of the pan to stop the sauce from catching or becoming lumpy.\r\nOnce thickened, transfer the sauce to a large bowl and stir in the mustard powder, cayenne pepper, Gruyère and egg yolks until fully combined.\r\nIn a spotlessly clean bowl and with a clean whisk, beat the egg whites just until peaks begin to form.\r\nCarefully fold the egg whites into the cheese sauce in three stages making sure you fold, rather than stir, to keep the egg whites light and airy. Fill the prepared ramekins with the soufflé mix.\r\nTop each soufflé with a slice of goat’s cheese, then place on a baking tray. Bake for 20-25 mins or until springy and well risen but cooked through.\r\nLeave to cool, then run a knife around the edge of each dish and remove the soufflés. If preparing in advance, place soufflés upside down (for neat presentation), on a tray. Cover tray in cling film. Chill for a few days or freeze for up to 1 month.\r\nWhen ready to re-bake, heat oven to 200C/180C fan/gas 6. Place the upside-down soufflés in a shallow baking dish, top with the remaining goat’s cheese slices and pour over the cream (this stops them from drying out when baked for the second time). Cook for 8-10 mins until golden. Serve immediately alongside some simply dressed salad.	0
clydjfbue05bzh8l57occcgpq	clydjc4jk011ih8l58zphplhy	Lasagne	2024-07-08 22:12:13.622	• Olive Oil 1 tblsp\n• Bacon 2\n• Onion 1 finely chopped\n• Celery 1 Stick\n• Carrots 1 medium\n• Garlic 2 cloves chopped\n• Minced Beef 500g\n• Tomato Puree 1 tbls\n• Chopped Tomatoes 800g\n• Honey 1 tblsp\n• Lasagne Sheets 500g\n• Creme Fraiche 400ml\n• Mozzarella Balls 125g\n• Parmesan Cheese 50g\n• Basil Leaves Topping	Heat the oil in a large saucepan. Use kitchen scissors to snip the bacon into small pieces, or use a sharp knife to chop it on a chopping board. Add the bacon to the pan and cook for just a few mins until starting to turn golden. Add the onion, celery and carrot, and cook over a medium heat for 5 mins, stirring occasionally, until softened.\r\nAdd the garlic and cook for 1 min, then tip in the mince and cook, stirring and breaking it up with a wooden spoon, for about 6 mins until browned all over.\r\nStir in the tomato purée and cook for 1 min, mixing in well with the beef and vegetables. Tip in the chopped tomatoes. Fill each can half full with water to rinse out any tomatoes left in the can, and add to the pan. Add the honey and season to taste. Simmer for 20 mins.\r\nHeat oven to 200C/180C fan/gas 6. To assemble the lasagne, ladle a little of the ragu sauce into the bottom of the roasting tin or casserole dish, spreading the sauce all over the base. Place 2 sheets of lasagne on top of the sauce overlapping to make it fit, then repeat with more sauce and another layer of pasta. Repeat with a further 2 layers of sauce and pasta, finishing with a layer of pasta.\r\nPut the crème fraîche in a bowl and mix with 2 tbsp water to loosen it and make a smooth pourable sauce. Pour this over the top of the pasta, then top with the mozzarella. Sprinkle Parmesan over the top and bake for 25–30 mins until golden and bubbling. Serve scattered with basil, if you like.	0
clydjf70p0565h8l5z7ru71rz	clydjc3m30104h8l5utijdcjk	Sugar Pie	2024-07-08 22:12:07.369	• Brown Sugar 2 cups\n• Butter ¼ cup\n• Eggs 2\n• Vanilla Extract 1 tsp\n• Salt 1 tsp\n• Plain Flour ½ cup\n• Milk 1 1/2 cups	Preheat oven to 350 degrees F (175 degrees C). Grease a 9-inch pie dish.\r\nPlace the brown sugar and butter in a mixing bowl, and beat them together with an electric mixer until creamy and very well combined, without lumps. Beat in eggs, one at a time, incorporating the first egg before adding the next one. Add the vanilla extract and salt; beat the flour in, a little at a time, and then the milk, making a creamy batter. Pour the batter into the prepared pie dish.\r\nBake in the preheated oven for 35 minutes; remove pie, and cover the rim with aluminum foil to prevent burning. Return to oven, and bake until the middle sets and the top forms a crusty layer, about 15 more minutes. Let the pie cool to room temperature, then refrigerate for at least 1 hour before serving.	0
clydjfayd05ath8l56pjbcncm	clydjc4jk011ih8l58zphplhy	Gołąbki (cabbage roll)	2024-07-08 22:12:12.469	• Cabbage 1\n• Butter 2 tbs\n• Onion 1 chopped\n• Ground Beef 1 lb\n• Ground Pork 1/2 lb\n• Rice 1 1/2 cups\n• Garlic 1 tsp\n• Salt 1 tsp\n• Black Pepper 1/4 tsp\n• Tomato Puree 3 cans	Bring a large pot of lightly salted water to a boil. Place cabbage head into water, cover pot, and cook until cabbage leaves are slightly softened enough to remove from head, 3 minutes. Remove cabbage from pot and let cabbage sit until leaves are cool enough to handle, about 10 minutes.\r\n\r\nRemove 18 whole leaves from the cabbage head, cutting out any thick tough center ribs. Set whole leaves aside. Chop the remainder of the cabbage head and spread it in the bottom of a casserole dish.\r\n\r\nMelt butter in a large skillet over medium-high heat. Cook and stir onion in hot butter until tender, 5 to 10 minutes. Cool.\r\n\r\nStir onion, beef, pork, rice, garlic, 1 teaspoon salt, and 1/4 teaspoon pepper together in a large bowl.\r\n\r\nPreheat oven to 350 degrees F (175 degrees C).\r\n\r\nPlace about 1/2 cup beef mixture on a cabbage leaf. Roll cabbage around beef mixture, tucking in sides to create an envelope around the meat. Repeat with remaining leaves and meat mixture. Place cabbage rolls in a layer atop the chopped cabbage in the casserole dish; season rolls with salt and black pepper.\r\n\r\nWhisk tomato soup, tomato juice, and ketchup together in a bowl. Pour tomato soup mixture over cabbage rolls and cover dish wish aluminum foil.\r\n\r\nBake in the preheated oven until cabbage is tender and meat is cooked through, about 1 hour.	0
clydjf7pg056xh8l5z6kzyist	clydjc3s2010th8l5xzf57ja7	Three Fish Pie	2024-07-08 22:12:08.26	• Potatoes 1kg\n• Butter Knob\n• Milk Dash\n• Gruyère 50g\n• Butter 75g\n• Leek 2 sliced\n• Plain Flour 75g\n• White Wine 150ml\n• Milk 568ml\n• Parsley 2 tbs chopped\n• Salmon 250g\n• Haddock 250g\n• Smoked Haddock 250g\n• Eggs 6	Preheat the oven to 200C/400F/Gas 6 (180C fan).\r\nPut the potatoes into a saucepan of cold salted water. Bring up to the boil and simmer until completely tender. Drain well and then mash with the butter and milk. Add pepper and taste to check the seasoning. Add salt and more pepper if necessary.\r\nFor the fish filling, melt the butter in a saucepan, add the leeks and stir over the heat. Cover with a lid and simmer gently for 10 minutes, or until soft. Measure the flour into a small bowl. Add the wine and whisk together until smooth.\r\nAdd the milk to the leeks, bring to the boil and then add the wine mixture. Stir briskly until thickened. Season and add the parsley and fish. Stir over the heat for two minutes, then spoon into an ovenproof casserole. Scatter over the eggs. Allow to cool until firm.\r\nSpoon the mashed potatoes over the fish mixture and mark with a fork. Sprinkle with cheese.\r\nBake for 30-40 minutes, or until lightly golden-brown on top and bubbling around the edges.	0
clydjf95n058vh8l53c7o2xlr	clydjc4jk011ih8l58zphplhy	Key Lime Pie	2024-07-08 22:12:10.14	• Digestive Biscuits 300g\n• Butter 150g\n• Condensed Milk 400g\n• Egg Yolks 3\n• Lime 4\n• Double Cream 300ml\n• Icing Sugar 1 tbls\n• Lime to serve	Heat the oven to 160C/fan 140C/gas 3. Whizz the biscuits to crumbs in a food processor (or put in a strong plastic bag and bash with a rolling pin). Mix with the melted butter and press into the base and up the sides of a 22cm loose-based tart tin. Bake in the oven for 10 minutes. Remove and cool.\r\nPut the egg yolks in a large bowl and whisk for a minute with electric beaters. Add the condensed milk and whisk for 3 minutes then add the zest and juice and whisk again for 3 minutes. Pour the filling into the cooled base then put back in the oven for 15 minutes. Cool then chill for at least 3 hours or overnight if you like.\r\nWhen you are ready to serve, carefully remove the pie from the tin and put on a serving plate. To decorate, softly whip together the cream and icing sugar. Dollop or pipe the cream onto the top of the pie and finish with extra lime zest.	0
clydjfcub05d5h8l5w7zzhnam	clydjc4s50127h8l5deg6tjdf	Lasagna Sandwiches	2024-07-08 22:12:14.916	• Sour Cream 1/4 cup\n• Chopped Onion 2 tbs\n• Dried Oregano 1/2 tbs\n• Salt 1/4 tsp\n• Bread 8 slices\n• Bacon 8 slices\n• Tomato 8 slices\n• Mozzarella 4 slices\n• Butter 2 1/2 Tbs	1. In a small bowl, combine the first four ingredients; spread on four slices of bread. Layer with bacon, tomato and cheese; top with remaining bread.\r\n\r\n2. In a large skillet or griddle, melt 2 tablespoons butter. Toast sandwiches until lightly browned on both sides and cheese is melted, adding butter if necessary.\r\n\r\nNutrition Facts\r\n1 sandwich: 445 calories, 24g fat (12g saturated fat), 66mg cholesterol, 1094mg sodium, 35g carbohydrate (3g sugars, 2g fiber), 21g protein.	0
clydjf9rf0599h8l5e5tkkbux	clydjc4jk011ih8l58zphplhy	Clam chowder	2024-07-08 22:12:10.923	• Clams 1½ kg\n• Butter 50g\n• Bacon 150g\n• Onion 1 finely chopped\n• Thyme sprigs of fresh\n• Bay Leaf 1\n• Plain Flour 1 tbls\n• Milk 150ml\n• Double Cream 150ml\n• Potatoes 2 medium\n• Parsley Chopped	Rinse the clams in several changes of cold water and drain well. Tip the clams into a large pan with 500ml of water. Cover, bring to the boil and simmer for 2 mins until the clams have just opened. Tip the contents of the pan into a colander over a bowl to catch the clam stock. When cool enough to handle, remove the clams from their shells – reserving a handful of empty shells for presentation if you want. Strain the clam stock into a jug, leaving any grit in the bottom of the bowl. You should have around 800ml stock.\r\nHeat the butter in the same pan and sizzle the bacon for 3-4 mins until it starts to brown. Stir in the onion, thyme and bay and cook everything gently for 10 mins until the onion is soft and golden. Scatter over the flour and stir in to make a sandy paste, cook for 2 mins more, then gradually stir in the clam stock then the milk and the cream.\r\nThrow in the potatoes, bring everything to a simmer and leave to bubble away gently for 10 mins or until the potatoes are cooked. Use a fork to crush a few of the potato chunks against the side of the pan to help thicken – you still want lots of defined chunks though. Stir through the clam meat and the few clam shells, if you've gone down that route, and simmer for a minute to reheat. Season with plenty of black pepper and a little salt, if needed, then stir through the parsley just before ladling into bowls or hollowed-out crusty rolls.	0
clydjfanj05afh8l5reoagqve	clydjc4jk011ih8l58zphplhy	Chocolate Raspberry Brownies	2024-07-08 22:12:12.079	• Dark Chocolate 200g\n• Milk Chocolate 100g\n• Salted Butter 250g\n• Light Brown Soft Sugar 400g\n• Eggs 4 large\n• Plain Flour 140g\n• Cocoa 50g\n• Raspberries 200g	Heat oven to 180C/160C fan/gas 4. Line a 20 x 30cm baking tray tin with baking parchment. Put the chocolate, butter and sugar in a pan and gently melt, stirring occasionally with a wooden spoon. Remove from the heat.\r\nStir the eggs, one by one, into the melted chocolate mixture. Sieve over the flour and cocoa, and stir in. Stir in half the raspberries, scrape into the tray, then scatter over the remaining raspberries. Bake on the middle shelf for 30 mins or, if you prefer a firmer texture, for 5 mins more. Cool before slicing into squares. Store in an airtight container for up to 3 days.	0
clydjfbjk05blh8l5ckoa6w1o	clydjc4jk011ih8l58zphplhy	Bread and Butter Pudding	2024-07-08 22:12:13.232	• butter 25g/1oz\n• bread 8 thin slices\n• sultanas 50g/2oz\n• cinnamon 2 tsp\n• milk 350ml/12fl\n• double cream 50ml/2fl oz\n• eggs 2 free-range\n• sugar 25g/1oz\n• nutmeg grated, to taste	Grease a 1 litre/2 pint pie dish with butter.\r\nCut the crusts off the bread. Spread each slice with on one side with butter, then cut into triangles.\r\nArrange a layer of bread, buttered-side up, in the bottom of the dish, then add a layer of sultanas. Sprinkle with a little cinnamon, then repeat the layers of bread and sultanas, sprinkling with cinnamon, until you have used up all of the bread. Finish with a layer of bread, then set aside.\r\nGently warm the milk and cream in a pan over a low heat to scalding point. Don't let it boil.\r\nCrack the eggs into a bowl, add three quarters of the sugar and lightly whisk until pale.\r\nAdd the warm milk and cream mixture and stir well, then strain the custard into a bowl.\r\nPour the custard over the prepared bread layers and sprinkle with nutmeg and the remaining sugar and leave to stand for 30 minutes.\r\nPreheat the oven to 180C/355F/Gas 4.\r\nPlace the dish into the oven and bake for 30-40 minutes, or until the custard has set and the top is golden-brown.	0
