clydjfu9005vfh8l585evhdhm	clydjc86o017rh8l557jqg88v	Matar Paneer	2024-07-08 22:12:37.476	• Sunflower Oil 1 tbls\n• Paneer 225g\n• Ginger 2\n• Cumin 1 tsp\n• Turmeric 1 tsp\n• Coriander 1 tsp\n• Green Chilli 1\n• Tomato 4 large\n• Peas 150g\n• Garam Masala 1 tsp\n• Coriander Small bunch\n• Naan Bread to serve	Heat the oil in a frying pan over high heat until it’s shimmering hot. Add the paneer, then turn the heat down a little. Fry until it starts to brown at the edges, then turn it over and brown on each side – the paneer will brown faster than you think, so don’t walk away. Remove the paneer from the pan and drain on kitchen paper.\r\nPut the ginger, cumin, turmeric, ground coriander and chilli in the pan, and fry everything for 1 min. Add the tomatoes, mashing them with the back of a spoon and simmer everything for 5 mins until the sauce smells fragrant. Add a splash of water if it’s too thick. Season well. Add the peas and simmer for a further 2 mins, then stir in the paneer and sprinkle over the garam masala. Divide between two bowls, top with coriander leaves and serve with naan bread, roti or rice.	0
clydjfvqg05wzh8l5qd9aocu5	clydjc8el018gh8l5hbiiv1u5	Beef Bourguignon	2024-07-08 22:12:39.4	• Goose Fat 3 tsp\n• Beef Shin 600g\n• Bacon 100g\n• Challots 350g\n• Chestnut Mushroom 250g\n• Garlic Clove 2 sliced\n• Bouquet Garni 1\n• Tomato Puree 1 tbs\n• Red Wine 750 ml\n• Celeriac 600g\n• Olive Oil 2 tbs\n• Thyme sprigs of fresh\n• Rosemary sprigs of fresh\n• Bay Leaf 2\n• Cardamom 4	Heat a large casserole pan and add 1 tbsp goose fat. Season the beef and fry until golden brown, about 3-5 mins, then turn over and fry the other side until the meat is browned all over, adding more fat if necessary. Do this in 2-3 batches, transferring the meat to a colander set over a bowl when browned.\r\nIn the same pan, fry the bacon, shallots or pearl onions, mushrooms, garlic and bouquet garni until lightly browned. Mix in the tomato purée and cook for a few mins, stirring into the mixture. This enriches the bourguignon and makes a great base for the stew. Then return the beef and any drained juices to the pan and stir through.\r\nPour over the wine and about 100ml water so the meat bobs up from the liquid, but isn’t completely covered. Bring to the boil and use a spoon to scrape the caramelised cooking juices from the bottom of the pan – this will give the stew more flavour.\r\nHeat oven to 150C/fan 130C/gas 2. Make a cartouche: tear off a square of foil slightly larger than the casserole, arrange it in the pan so it covers the top of the stew and trim away any excess foil. Then cook for 3 hrs. If the sauce looks watery, remove the beef and veg with a slotted spoon, and set aside. Cook the sauce over a high heat for a few mins until the sauce has thickened a little, then return the beef and vegetables to the pan.\r\nTo make the celeriac mash, peel the celeriac and cut into cubes. Heat the olive oil in a large frying pan. Tip in the celeriac and fry for 5 mins until it turns golden. Season well with salt and pepper. Stir in the rosemary, thyme, bay and cardamom pods, then pour over 200ml water, enough to nearly cover the celeriac. Turn the heat to low, partially cover the pan and leave to simmer for 25-30 mins.\r\nAfter 25-30 mins, the celeriac should be soft and most of the water will have evaporated. Drain away any remaining water, then remove the herb sprigs, bay and cardamom pods. Lightly crush with a potato masher, then finish with a glug of olive oil and season to taste. Spoon the beef bourguignon into serving bowls and place a large spoonful of the celeriac mash on top. Garnish with one of the bay leaves, if you like.	0
