clydjgzz806zhh8l50dvshuwg	clydjcbma01i6h8l5ktysuyhx	Rigatoni with fennel sausage sauce	2024-07-08 22:13:31.556	• olive oil 2½ tbsp\n• Italian fennel sausages 6 cut into 1.5cm-thick slices\n• onion 1 large peeled and chopped\n• fennel bulb 1 trimmed and roughly chopped; reserve any fronds to garnish\n• smoky paprika ½ tsp\n• garlic 1 clove, peeled and sliced\n• fennel seeds 2 tsp lightly toasted and then gently crushed\n• red wine 100ml\n• chopped tomatoes 400g tinned\n• caster sugar ½ tsp\n• pitted black olives 50g cut in half lengthways\n• rigatoni 500g\n• pecorino 30g roughly crumbled into 0.5cm pieces\n• anchovy fillet 1  rinsed and patted dry\n• garlic 1 clove, peeled and crushed\n• olive oil 60ml\n• basil leaves 50g torn	Heat a tablespoon of oil in a large saute pan for which you have a lid. Add the sausage pieces and fry on a medium-high heat for 10 minutes, stirring regularly, until golden-brown all over. Transfer the sausages to a plate, then add the onion and fennel to the hot pan and fry for 15 minutes, stirring once in a while, until soft and caramelised; if the pan goes a bit dry, add a teaspoon or so of extra oil. Stir in the paprika, garlic and half the fennel seeds, fry for two minutes more, then pour on the wine and boil for 30 seconds, to reduce by half. Add the tomatoes, sugar, 100ml water, the seared sausage and half a teaspoon of salt, cover and simmer for 30 minutes; remove the lid after 10 minutes, and cook until the sauce is thick and rich. Remove from the heat, stir through the olives and remaining fennel seeds and set aside until you’re ready to serve.\r\n\r\nBring a large pot of salted water to a boil, add the pasta and cook for 12-14 minutes (or according to the instructions on the packet), until al dente. Meanwhile, reheat the sauce. Drain the pasta, return it to the pot, stir in a tablespoon of oil, then divide between the bowls. \r\n\r\nPut all the pesto ingredients except the basil in the small bowl of a food processor. Add a tablespoon of water and blitz to a rough paste. Add the basil, then blitz until just combined (the pesto has a much better texture if the basil is not overblended).\r\n\r\nSpoon over the ragù and top with a spoonful of pesto. Finish with a sprinkling of chopped fennel fronds, if you have any, and serve at once.	0
