clydjhdpx07glh8l5y5q55ep4	clydjccx901n1h8l5vf9etk9l	Beef Dumpling Stew	2024-07-08 22:13:49.366	• Olive Oil 2 tbs\n• Butter 25g\n• Beef 750g\n• Plain Flour 2 tblsp\n• Garlic 2 cloves minced\n• Onions 175g\n• Celery 150g\n• Carrots 150g\n• Leek 2 chopped\n• Swede 200g\n• Red Wine 150ml\n• Beef Stock 500g\n• Bay Leaf 2\n• Thyme 3 tbs\n• Parsley 3 tblsp chopped\n• Plain Flour 125g\n• Baking Powder 1 tsp\n• Suet 60g\n• Water Splash	Preheat the oven to 180C/350F/Gas 4.\r\n\r\nFor the beef stew, heat the oil and butter in an ovenproof casserole and fry the beef until browned on all sides.\r\n\r\nSprinkle over the flour and cook for a further 2-3 minutes.\r\n\r\nAdd the garlic and all the vegetables and fry for 1-2 minutes.\r\n\r\nStir in the wine, stock and herbs, then add the Worcestershire sauce and balsamic vinegar, to taste. Season with salt and freshly ground black pepper.\r\n\r\nCover with a lid, transfer to the oven and cook for about two hours, or until the meat is tender.\r\n\r\nFor the dumplings, sift the flour, baking powder and salt into a bowl.\r\nAdd the suet and enough water to form a thick dough.\r\n\r\nWith floured hands, roll spoonfuls of the dough into small balls.\r\n\r\nAfter two hours, remove the lid from the stew and place the balls on top of the stew. Cover, return to the oven and cook for a further 20 minutes, or until the dumplings have swollen and are tender. (If you prefer your dumplings with a golden top, leave the lid off when returning to the oven.)\r\n\r\nTo serve, place a spoonful of mashed potato onto each of four serving plates and top with the stew and dumplings. Sprinkle with chopped parsley.	0
