clydjil7m09m3h8l54mim7m5x	clydji8tm08jdh8l5m2243h9q	Walnut Roll Gužvara	2024-07-08 22:14:45.73	• Flour 450g\n• Caster Sugar 55g\n• Yeast 2 parts\n• Salt 1/2 tsp\n• Milk 6 oz\n• Eggs 2 Beaten\n• Butter 30g\n• Walnuts 140g\n• Butter 85g\n• Brown Sugar 85g\n• Cinnamon 1 tsp\n• Milk To Glaze\n• Icing Sugar To Glaze	Mix all the ingredients for the dough together and knead well. Cover the dough and put to rise until doubled in size which should take about 2 hours. Knock back the dough and knead lightly.\r\n\r\nDivide the dough into two equal pieces; roll each piece into an oblong about 12 inches by 8 inches. Mix the filling ingredients together and divide between the dough, spreading over each piece. Roll up the oblongs as tightly as possible to give two 12 inch sausages. Place these side by side, touching each other, on a greased baking sheet. Cover and leave to rise for about 40 minutes. Heat oven to 200ºC (425ºF). Bake for 30-35 minutes until well risen and golden brown. Bread should sound hollow when the base is tapped.\r\n\r\nRemove from oven and brush the hot bread top with milk. Sift with a generous covering of icing sugar.	0
