clydjieak090bh8l5v0v2zzai	clydji8nv08ioh8l581tc52ch	Rappie Pie	2024-07-08 22:14:36.764	• Butter 2 tbs\n• Onions 2 chopped\n• Chicken Stock 4 qt\n• Chicken Breast 1.5kg\n• Potatoes 4kg\n• Salt 2 tbs\n• Black Pepper 1tbsp	Preheat oven to 400 degrees F (200 degrees C). Grease a 10x14x2-inch baking pan.\r\nHeat margarine in a skillet over medium heat; stir in onion. Cook and stir until onion has softened and turned translucent, about 5 minutes. Reduce heat to low and continue to cook and stir until onion is very tender and dark brown, about 40 minutes more.\r\nBring chicken broth to a boil in a large pot; stir in chicken breasts, reduce heat, and simmer until chicken is no longer pink at the center, about 20 minutes. Remove from heat. Remove chicken breasts to a plate using a slotted spoon; reserve broth.\r\nJuice potatoes with an electric juicer; place dry potato flesh into a bowl and discard juice. Stir salt and pepper into potatoes; stir in enough reserved broth to make the mixture the consistency of oatmeal. Set remaining broth aside.\r\nSpread half of potato mixture evenly into the prepared pan. Lay cooked chicken breast evenly over potatoes; scatter caramelized onion evenly over chicken. Spread remaining potato mixture over onions and chicken to cover.\r\nBake in the preheated oven until golden brown, about 1 hour. Reheat chicken broth; pour over individual servings as desired.	0
clydjif1k092lh8l540yv3zxq	clydji8nv08ioh8l581tc52ch	Eccles Cakes	2024-07-08 22:14:37.736	• Butter 250g\n• Plain Flour 350g\n• Lemon Juice of 1/2\n• Butter 25g\n• Currants 200g\n• Mixed Peel 50g\n• Muscovado Sugar 100g\n• Cinnamon 1 tsp\n• Ginger 1 tsp\n• Allspice 1 tsp\n• Lemon Zest of 1\n• Eggs 1 beaten\n• Sugar spinkling	To make the pastry, dice the butter and put it in the freezer to go really hard. Tip flour into the bowl of a food processor with half the butter and pulse to the texture of breadcrumbs. Pour in the lemon juice and 100ml iced water, and pulse to a dough. Tip in the rest of the butter and pulse a few times until the dough is heavily flecked with butter. It is important that you don’t overdo this as the flecks of butter are what makes the pastry flaky.\r\nOn a floured surface roll the pastry out to a neat rectangle about 20 x 30cm. Fold the two ends of the pastry into the middle (See picture 1), then fold in half (pic 2). Roll the pastry out again and refold the same way 3 more times resting the pastry for at least 15 mins each time between roll and fold, then leave to rest in the fridge for at least 30 mins before using.\r\nTo make the filling, melt the butter in a large saucepan. Take it off the heat and stir in all the other ingredients until completely mixed, then set aside.\r\nTo make the cakes, roll the pastry out until it’s just a little thicker than a £1 coin and cut out 8 rounds about 12cm across. Re-roll the trimming if needed. Place a good heaped tablespoon of mixture in the middle of each round, brush the edges of the rounds with water, then gather the pastry around the filling and squeeze it together (pic 3). Flip them over so the smooth top is upwards and pat them into a smooth round. Flatten each round with a rolling pin to an oval until the fruit just starts to poke through, then place on a baking tray. Cut 2 little slits in each Eccles cakes, brush generously with egg white and sprinkle with the sugar (pic 4).\r\nHeat the oven to 220C/200C fan/gas 8. Bake the Eccles cakes for 15-20 mins until just past golden brown and sticky. Leave to cool on a rack and enjoy while still warm or cold with a cup of tea. If you prefer, Eccles cakes also go really well served with a wedge of hard, tangy British cheese such as Lancashire or cheddar.	0
clydjifr3093zh8l5zzba6mtj	clydji8nv08ioh8l581tc52ch	French Onion Soup	2024-07-08 22:14:38.655	• Butter 50g\n• Olive Oil 1 tbs\n• Onion 1 kg\n• Sugar 1 tsp\n• Garlic Clove 4 sliced\n• Plain Flour 2 tbs\n• Dry White Wine 250ml\n• Beef Stock 1L\n• Bread 4 sliced\n• Gruyère 140g	Melt the butter with the oil in a large heavy-based pan. Add the onions and fry with the lid on for 10 mins until soft. Sprinkle in the sugar and cook for 20 mins more, stirring frequently, until caramelised. The onions should be really golden, full of flavour and soft when pinched between your fingers. Take care towards the end to ensure that they don’t burn.\r\nAdd the garlic for the final few mins of the onions’ cooking time, then sprinkle in the flour and stir well. Increase the heat and keep stirring as you gradually add the wine, followed by the hot stock. Cover and simmer for 15-20 mins.\r\nTo serve, turn on the grill, and toast the bread. Ladle the soup into heatproof bowls. Put a slice or two of toast on top of the bowls of soup, and pile on the cheese. Grill until melted. Alternatively, you can complete the toasts under the grill, then serve them on top.	0
clydjigyi0985h8l5yzvcfjgx	clydji8nv08ioh8l581tc52ch	Beef Bourguignon	2024-07-08 22:14:40.218	• Goose Fat 3 tsp\n• Beef Shin 600g\n• Bacon 100g\n• Challots 350g\n• Chestnut Mushroom 250g\n• Garlic Clove 2 sliced\n• Bouquet Garni 1\n• Tomato Puree 1 tbs\n• Red Wine 750 ml\n• Celeriac 600g\n• Olive Oil 2 tbs\n• Thyme sprigs of fresh\n• Rosemary sprigs of fresh\n• Bay Leaf 2\n• Cardamom 4	Heat a large casserole pan and add 1 tbsp goose fat. Season the beef and fry until golden brown, about 3-5 mins, then turn over and fry the other side until the meat is browned all over, adding more fat if necessary. Do this in 2-3 batches, transferring the meat to a colander set over a bowl when browned.\r\nIn the same pan, fry the bacon, shallots or pearl onions, mushrooms, garlic and bouquet garni until lightly browned. Mix in the tomato purée and cook for a few mins, stirring into the mixture. This enriches the bourguignon and makes a great base for the stew. Then return the beef and any drained juices to the pan and stir through.\r\nPour over the wine and about 100ml water so the meat bobs up from the liquid, but isn’t completely covered. Bring to the boil and use a spoon to scrape the caramelised cooking juices from the bottom of the pan – this will give the stew more flavour.\r\nHeat oven to 150C/fan 130C/gas 2. Make a cartouche: tear off a square of foil slightly larger than the casserole, arrange it in the pan so it covers the top of the stew and trim away any excess foil. Then cook for 3 hrs. If the sauce looks watery, remove the beef and veg with a slotted spoon, and set aside. Cook the sauce over a high heat for a few mins until the sauce has thickened a little, then return the beef and vegetables to the pan.\r\nTo make the celeriac mash, peel the celeriac and cut into cubes. Heat the olive oil in a large frying pan. Tip in the celeriac and fry for 5 mins until it turns golden. Season well with salt and pepper. Stir in the rosemary, thyme, bay and cardamom pods, then pour over 200ml water, enough to nearly cover the celeriac. Turn the heat to low, partially cover the pan and leave to simmer for 25-30 mins.\r\nAfter 25-30 mins, the celeriac should be soft and most of the water will have evaporated. Drain away any remaining water, then remove the herb sprigs, bay and cardamom pods. Lightly crush with a potato masher, then finish with a glug of olive oil and season to taste. Spoon the beef bourguignon into serving bowls and place a large spoonful of the celeriac mash on top. Garnish with one of the bay leaves, if you like.	0
clydjihjl099rh8l50xlq9ttv	clydji8nv08ioh8l581tc52ch	Chicken Fajita Mac and Cheese	2024-07-08 22:14:40.977	• macaroni 500g\n• chicken stock 2 cups\n• heavy cream 1/2 cup\n• fajita seasoning 1 packet\n• salt 1 tsp\n• chicken breast 3 diced\n• olive oil 2 tbsp\n• onion 1 small finely diced\n• red pepper 2 finely diced\n• garlic 2 cloves minced\n• cheddar cheese 1 cup\n• parsley garnish chopped	Fry your onion, peppers and garlic in olive oil until nicely translucent. Make a well in your veg and add your chicken. Add your seasoning and salt. Allow to colour slightly.\r\nAdd your cream, stock and macaroni.\r\nCook on low for 20 minutes. Add your cheeses, stir to combine.\r\nTop with roasted peppers and parsley.	0
clydjii5009b9h8l5dau4rz2k	clydji8tm08jdh8l5m2243h9q	Beef Caldereta	2024-07-08 22:14:41.748	• Beef 2kg cut cubes\n• Beef Stock 1\n• Soy Sauce 1 tbs\n• Water 2 cups\n• Green Pepper 1 sliced\n• Red Pepper 1 sliced\n• Potatoes 1 sliced\n• Carrots 1 sliced\n• Tomato Puree 8 ounces\n• Peanut Butter 3  tablespoons\n• Chilli Powder 5\n• Onion 1 chopped\n• Garlic 5 cloves\n• Olive Oil 3 tbs	0.\tHeat oil in a cooking pot. Saute onion and garlic until onion softens\r\n1.\tAdd beef. Saute until the outer part turns light brown.\r\n2.\tAdd soy sauce. Pour tomato sauce and water. Let boil.\r\n3.\tAdd Knorr Beef Cube. Cover the pressure cooker. Cook for 30 minutes.\r\n4.\tPan-fry carrot and potato until it browns. Set aside.\r\n5.\tAdd chili pepper, liver spread and peanut butter. Stir.\r\n6.\tAdd bell peppers, fried potato and carrot. Cover the pot. Continue cooking for 5 to 7 minutes.\r\n7.\tSeason with salt and ground black pepper. Serve.\r\n	0
clydjiig109brh8l5l4uzdy35	clydji8tm08jdh8l5m2243h9q	Bean & Sausage Hotpot	2024-07-08 22:14:42.145	• Sausages 8 large\n• Tomato Sauce 1 Jar\n• Butter Beans 1200g\n• Black Treacle 1 tbls\n• English Mustard 1 tsp	In a large casserole, fry the sausages until brown all over – about 10 mins.\r\n\r\nAdd the tomato sauce, stirring well, then stir in the beans, treacle or sugar and mustard. Bring to the simmer, cover and cook for 30 mins. Great served with crusty bread or rice.	0
clydjisi00aadh8l5s4x0dnhj	clydji8tm08jdh8l5m2243h9q	Lamb Rogan josh	2024-07-08 22:14:55.176	• Onion 2 quartered\n• Sunflower Oil 4 tbsp\n• Garlic 4 cloves\n• Ginger Thumb sized peeled and very finely grated\n• Madras Paste 2 tbsp\n• Paprika 2 tsp\n• cinnamon stick 1\n• Cardamom 6 bashed to break shells\n• Clove 4\n• Bay Leaf 2\n• Tomato Purée 1 tbsp\n• Lamb 1kg cubed\n• Greek yogurt 150ml\n• Coriander Garnish chopped	\r\nPut the onions in a food processor and whizz until very finely chopped. Heat the oil in a large heavy-based pan, then fry the onion with the lid on, stirring every now and then, until it is really golden and soft. Add the garlic and ginger, then fry for 5 mins more.\r\nTip the curry paste, all the spices and the bay leaves into the pan, with the tomato purée. Stir well over the heat for about 30 secs, then add the meat and 300ml water. Stir to mix, turn down the heat, then add the yogurt.\r\nCover the pan, then gently simmer for 40-60 mins until the meat is tender and the sauce nice and thick. Serve scattered with coriander, with plain basmati or pilau rice.	0
clydjitwy0affh8l5jx1x2awf	clydji8tm08jdh8l5m2243h9q	Spaghetti alla Carbonara	2024-07-08 22:14:57.011	• Spaghetti 320g\n• Egg Yolks 6\n• Salt As required\n• Bacon 150g\n• Pecorino 50g\n• Black Pepper As required	STEP 1\r\nPut a large saucepan of water on to boil.\r\n\r\nSTEP 2\r\nFinely chop the 100g pancetta, having first removed any rind. Finely grate 50g pecorino cheese and 50g parmesan and mix them together.\r\n\r\nSTEP 3\r\nBeat the 3 large eggs in a medium bowl and season with a little freshly grated black pepper. Set everything aside.\r\n\r\nSTEP 4\r\nAdd 1 tsp salt to the boiling water, add 350g spaghetti and when the water comes back to the boil, cook at a constant simmer, covered, for 10 minutes or until al dente (just cooked).\r\n\r\nSTEP 5\r\nSquash 2 peeled plump garlic cloves with the blade of a knife, just to bruise it.\r\n\r\nSTEP 6\r\nWhile the spaghetti is cooking, fry the pancetta with the garlic. Drop 50g unsalted butter into a large frying pan or wok and, as soon as the butter has melted, tip in the pancetta and garlic.\r\n\r\nSTEP 7\r\nLeave to cook on a medium heat for about 5 minutes, stirring often, until the pancetta is golden and crisp. The garlic has now imparted its flavour, so take it out with a slotted spoon and discard.\r\n\r\nSTEP 8\r\nKeep the heat under the pancetta on low. When the pasta is ready, lift it from the water with a pasta fork or tongs and put it in the frying pan with the pancetta. Don’t worry if a little water drops in the pan as well (you want this to happen) and don’t throw the pasta water away yet.\r\n\r\nSTEP 9\r\nMix most of the cheese in with the eggs, keeping a small handful back for sprinkling over later.\r\n\r\nSTEP 10\r\nTake the pan of spaghetti and pancetta off the heat. Now quickly pour in the eggs and cheese. Using the tongs or a long fork, lift up the spaghetti so it mixes easily with the egg mixture, which thickens but doesn’t scramble, and everything is coated.\r\n\r\nSTEP 11\r\nAdd extra pasta cooking water to keep it saucy (several tablespoons should do it). You don’t want it wet, just moist. Season with a little salt, if needed.\r\n\r\nSTEP 12\r\nUse a long-pronged fork to twist the pasta on to the serving plate or bowl. Serve immediately with a little sprinkling of the remaining cheese and a grating of black pepper. If the dish does get a little dry before serving, splash in some more hot pasta water and the glossy sauciness will be revived.	0
clydjivec0amdh8l5epbelps9	clydji8tm08jdh8l5m2243h9q	Chicken Handi	2024-07-08 22:14:58.932	• Chicken 1.2 kg\n• Onion 5 thinly sliced\n• Tomatoes 2 finely chopped\n• Garlic 8 cloves chopped\n• Ginger paste 1 tbsp\n• Vegetable oil ¼ cup\n• Cumin seeds 2 tsp\n• Coriander seeds 3 tsp\n• Turmeric powder 1 tsp\n• Chilli powder 1 tsp\n• Green chilli 2\n• Yogurt 1 cup\n• Cream ¾ cup\n• fenugreek 3 tsp Dried\n• Garam masala 1 tsp\n• Salt To taste	Take a large pot or wok, big enough to cook all the chicken, and heat the oil in it. Once the oil is hot, add sliced onion and fry them until deep golden brown. Then take them out on a plate and set aside.\r\nTo the same pot, add the chopped garlic and sauté for a minute. Then add the chopped tomatoes and cook until tomatoes turn soft. This would take about 5 minutes.\r\nThen return the fried onion to the pot and stir. Add ginger paste and sauté well.\r\nNow add the cumin seeds, half of the coriander seeds and chopped green chillies. Give them a quick stir.\r\nNext goes in the spices – turmeric powder and red chilli powder. Sauté the spices well for couple of minutes.\r\nAdd the chicken pieces to the wok, season it with salt to taste and cook the chicken covered on medium-low heat until the chicken is almost cooked through. This would take about 15 minutes. Slowly sautéing the chicken will enhance the flavor, so do not expedite this step by putting it on high heat.\r\nWhen the oil separates from the spices, add the beaten yogurt keeping the heat on lowest so that the yogurt doesn’t split. Sprinkle the remaining coriander seeds and add half of the dried fenugreek leaves. Mix well.\r\nFinally add the cream and give a final mix to combine everything well.\r\nSprinkle the remaining kasuri methi and garam masala and serve the chicken handi hot with naan or rotis. Enjoy!	0
clydjiwkr0ar7h8l5bcmf7ny4	clydji8tm08jdh8l5m2243h9q	Pouding chomeur	2024-07-08 22:15:00.458	• Butter ½ cup\n• Sugar 1 cup\n• Eggs 2\n• Vanilla Extract 1 tsp\n• Flour 2 cups\n• Baking Powder 1 tsp\n• Milk 1 1/4 cup\n• Maple Syrup 1 1/2 cup\n• Brown Sugar 1 1/2 cup\n• Single Cream 1 1/2 cup\n• Butter 1/3 cup	In a large bowl, with an electric mixer, mix the butter and sugar till the mix is light.\r\nAdd eggs and vanilla and mix.\r\nIn another bowl, mix flour and baking powder.\r\nAlternate flour mix and milk to the butter mix.\r\nPour into a 13 inch by 9 inch greased pan.\r\nMAPLE SAUCE.\r\nIn a large casserole, bring to boil the syrup, brown sugar, cream and butter and constantly stir.\r\nReduce heat and and gently cook 2 minutes or till sauce has reduced a little bit.\r\nPour sauce gently over cake.\r\nBake at 325°f (160°c) about 35 minutes or till cake is light brown and when toothpick inserted comes out clean.	0
